import React from 'react'

export default function AddUser() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6 offset-md-3 border rounded p-4 mt-2 shadow">
          <h4 className="text-center m-4">Register user</h4>
        </div>
      </div>
    </div>
  )
}
